        return(
            <aside>
            <h2>Menu</h2>
            <button >Tomato</button>
            <button >Cheese</button>
            <button >Bun</button>
            <button >Patty</button> 
            <button >Reset</button>
            </aside>
        )

    }

}

export default NavBar
